import{_ as e,c as a,o as r,V as t}from"./chunks/framework.35c8bad0.js";const f=JSON.parse('{"title":"JavaScript标准内置对象","description":"","frontmatter":{"title":"JavaScript标准内置对象","date":"2024-11-05T00:00:00.000Z"},"headers":[],"relativePath":"frontend/javascript-reference/241105.md","lastUpdated":1730860894000}'),o={name:"frontend/javascript-reference/241105.md"},s=t('<h1 id="javascript标准内置对象" tabindex="-1">JavaScript标准内置对象 <a class="header-anchor" href="#javascript标准内置对象" aria-label="Permalink to &quot;JavaScript标准内置对象&quot;">​</a></h1><h2 id="_1-函数属性" tabindex="-1">1. 函数属性 <a class="header-anchor" href="#_1-函数属性" aria-label="Permalink to &quot;1. 函数属性&quot;">​</a></h2><p>全局函数可以直接调用，不需要在调用时指定所属对象，执行结束后会将结果直接返回给调用者。</p><h3 id="_1-1-parseint" tabindex="-1">1.1 parseInt <a class="header-anchor" href="#_1-1-parseint" aria-label="Permalink to &quot;1.1 parseInt&quot;">​</a></h3><p><strong>parseInt(string, radix)</strong> 解析一个字符串并返回指定基数的十进制整数，<code>radix</code> 是 2-36 之间的整数，表示被解析字符串的基数。</p><h4 id="语法" tabindex="-1">语法 <a class="header-anchor" href="#语法" aria-label="Permalink to &quot;语法&quot;">​</a></h4><div class="language-javascript line-numbers-mode"><button title="Copy Code" class="copy"></button><span class="lang">javascript</span><pre class="shiki material-theme-palenight"><code><span class="line"><span style="color:#82AAFF;">parseInt</span><span style="color:#A6ACCD;">(string</span><span style="color:#89DDFF;">,</span><span style="color:#A6ACCD;"> radix)</span><span style="color:#89DDFF;">;</span></span></code></pre><div class="line-numbers-wrapper" aria-hidden="true"><span class="line-number">1</span><br></div></div><h4 id="参数" tabindex="-1">参数 <a class="header-anchor" href="#参数" aria-label="Permalink to &quot;参数&quot;">​</a></h4><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/parseInt#string" target="_blank" rel="noreferrer"><code>string</code></a></p><p>要被解析的值。如果参数不是一个字符串，则将其转换为字符串 (使用 <a href="https://www.ecma-international.org/ecma-262/6.0/#sec-tostring" target="_blank" rel="noreferrer"><code>ToString</code></a>抽象操作)。字符串开头的空白符将会被忽略。</p><p><a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/parseInt#radix" target="_blank" rel="noreferrer"><code>radix</code></a> 可选</p><p>从 <code>2</code> 到 <code>36</code> 的整数，表示进制的基数。例如指定 <code>16</code> 表示被解析值是十六进制数。如果超出这个范围，将返回 <code>NaN</code>。假如指定 <code>0</code> 或未指定，基数将会根据字符串的值进行推算。注意，推算的结果不会永远是默认值 <code>10</code>！</p><h4 id="返回值" tabindex="-1">返回值 <a class="header-anchor" href="#返回值" aria-label="Permalink to &quot;返回值&quot;">​</a></h4><p>从给定的字符串中解析出的一个整数。</p><p>或者 <a href="https://developer.mozilla.org/zh-CN/docs/Web/JavaScript/Reference/Global_Objects/NaN" target="_blank" rel="noreferrer"><code>NaN</code></a>，当</p><ul><li><code>radix</code> 小于 <code>2</code> 或大于 <code>36</code>，或</li><li>第一个非空格字符不能转换为数字。</li></ul>',16),c=[s];function n(l,i,d,p,h,_){return r(),a("div",null,c)}const u=e(o,[["render",n]]);export{f as __pageData,u as default};
